package com.github.digdeep126.packet;

import java.security.NoSuchAlgorithmException;

import javax.xml.bind.DatatypeConverter;

import com.github.digdeep126.util.ByteWriteUtil;
import com.github.digdeep126.util.SecurityUtil;

/**
 * Protocol::HandshakeResponse41:
	Handshake Response Packet sent by 4.1+ clients supporting CLIENT_PROTOCOL_41 capability, 
	if the server announced it in its Initial Handshake Packet. 
	Otherwise (talking to an old server) the Protocol::HandshakeResponse320 packet must be used.
	
	Payload
	4              capability flags, CLIENT_PROTOCOL_41 always set
	4              max-packet size
	1              character set
	string[23]     reserved (all [0])
	string[NUL]    username
	if capabilities & CLIENT_PLUGIN_AUTH_LENENC_CLIENT_DATA {
		lenenc-int     length of auth-response
		string[n]      auth-response
	} else if capabilities & CLIENT_SECURE_CONNECTION {
		1              length of auth-response
		string[n]      auth-response
	} else {
		string[NUL]    auth-response
	}
	if capabilities & CLIENT_CONNECT_WITH_DB {
		string[NUL]    database
	}
	if capabilities & CLIENT_PLUGIN_AUTH {
		string[NUL]    auth plugin name
	}
	if capabilities & CLIENT_CONNECT_ATTRS {
		lenenc-int     length of all key-values
		lenenc-str     key
		lenenc-str     value
	    if-more data in 'length of all key-values', more keys and value pairs
	}
	  
	Fields
	capability_flags (4) -- capability flags of the client as defined in Protocol::CapabilityFlags
	max_packet_size (4) -- max size of a command packet that the client wants to send to the server
	character_set (1) -- connection's default character set as defined in Protocol::CharacterSet.
	username (string.fix_len) -- name of the SQL account which client wants to log in -- 
	this string should be interpreted using the character set indicated by character set field.
	
	auth-response (string.NUL) -- opaque authentication response data generated by Authentication Method 
	indicated by the plugin name field.
	
	database (string.NUL) -- initail database for the connection -- this string should be interpreted using 
	the character set indicated by character set field.
	
	auth plugin name (string.NUL) -- the Authentication Method used by the client to generate auth-response 
	value in this packet. This is an UTF-8 string.
	
 * @author digdeep@126.com
 *
 */
@SuppressWarnings("restriction")
public class AuthPacket extends Packet{
	private static final byte[] FILLER = new byte[23];	//string[23]     reserved (all [0])
	
	public long clientCapabilitityFlags;
	public long maxPacketSize;
	public int  charsetIndex;
	public byte[] reserved = FILLER;	// for FILLER(23)
	public String username;
	public byte[] password;
	public String database;
	
	public AuthPacket(byte[] data){
    	this.clientCapabilitityFlags = initClientFlags();
    	this.maxPacketSize = MAX_PACKET_SIZE;
    	this.charsetIndex = 46;
    	this.reserved = FILLER;
    	this.username = "root";
    	ServerHandShake handshake = new ServerHandShake(data);
    	try {
			this.password = passwd("lexin1123581", handshake);
			@SuppressWarnings("restriction")
			String hex = DatatypeConverter.printHexBinary(password);
//			System.out.println("password: " + hex);	//5FAE48FFE2B89781624A09FC7E06B238D7FCD358
		} catch (NoSuchAlgorithmException e) {
			e.printStackTrace();
		} 
//    	this.database = "mysql";
    	this.packetSequenceId = handshake.packetSequenceId + 1;
    	
    	System.out.println("******HandShakeResponse.packetSequenceId:" + packetSequenceId);
	}
	
	public AuthPacket(ServerHandShake handshake){
    	this.clientCapabilitityFlags = initClientFlags();
    	this.maxPacketSize = MAX_PACKET_SIZE;
    	this.charsetIndex = 33;
    	this.reserved = FILLER;
    	this.username = "root";
    	try {
			this.password = passwd("lexin112358", handshake);
			@SuppressWarnings("restriction")
			String hex = DatatypeConverter.printHexBinary(password);
//			System.out.println("password: " + hex);	//5FAE48FFE2B89781624A09FC7E06B238D7FCD358
		} catch (NoSuchAlgorithmException e) {
			e.printStackTrace();
		} 
    	this.database = "mysql";
    	this.packetSequenceId = handshake.packetSequenceId + 1;
    	
    	System.out.println("******HandShakeResponse.packetSequenceId:" + packetSequenceId);
	}
	
	public byte[] getBytes() {
		byte[] buffer = new byte[70];
		int offset = 0;
		
//		4              capability flags, CLIENT_PROTOCOL_41 always set
//		4              max-packet size
//		1              character set
//		string[23]     reserved (all [0])
//		string[NUL]    username
		
//		  if capabilities & CLIENT_PLUGIN_AUTH_LENENC_CLIENT_DATA {
//				lenenc-int     length of auth-response
//				string[n]      auth-response
//		  } else if capabilities & CLIENT_SECURE_CONNECTION {
//				1              length of auth-response
//				string[n]      auth-response
//		  } else {
//				string[NUL]    auth-response
//		  }
//		result: 400000 01  CFB70300 00000001 21 0000000000000000000000000000000000000000000000
//		username
//		726F6F7400 1400000000000000000000000000000000000000 
		//ByteWriteUtil.writeUB3(buffer, offset, size);
//		password: 28721A94D0B535AFB4398416C8629C1C99286B46
//		        header   cap      max-size charset reserved 23                                     username
//		result: 00000001 CFB70300 00000001 21      0000000000000000000000000000000000000000000000  726F6F7400 
		
//		1400000000000000000000000000000000000000006D7973716C000000

		offset += 3;
		ByteWriteUtil.writeUB1(buffer, offset, packetSequenceId);
		offset += 1;
		
		//========payload=========
		ByteWriteUtil.writeUB4(buffer, offset, clientCapabilitityFlags);
		offset += 4;
		
//		0x: 1 00 00 00
		ByteWriteUtil.writeUB4(buffer, offset, maxPacketSize);
		offset += 4;
		
		ByteWriteUtil.writeUB1(buffer, offset, charsetIndex);
		offset += 1;
		
		ByteWriteUtil.writeBytes(buffer, offset, this.reserved);
		offset += FILLER.length;	// 23
		
		ByteWriteUtil.writeBytesWithNULL(buffer, offset, username.getBytes());
		offset += username.getBytes().length+1;
		
//		1              length of auth-response
//		string[n]      auth-response
		ByteWriteUtil.writeWithLength(buffer, offset, password);
		offset += ByteWriteUtil.getLength(password);
		
		ByteWriteUtil.writeBytesWithNULL(buffer, offset, database.getBytes());
		offset += database.getBytes().length + 1;

		packetLen = offset-4;
		ByteWriteUtil.writeUB3(buffer, 0, packetLen);	// 头部的开始3字节表示payload长度：头部4字节不计算在内
		
//		System.out.println("packageLen: " + packetLen);	// 64
		return buffer;
	}
	
	private static byte[] passwd(String pass, ServerHandShake hs) throws NoSuchAlgorithmException {
		if (pass == null || pass.length() == 0) {
			return null;
		}
		byte[] passwd = pass.getBytes();
		int sl1 = hs.authPluginPart1.length;
		int sl2 = hs.authPluginPart2.length;
		byte[] seed = new byte[sl1 + sl2];
		System.arraycopy(hs.authPluginPart1, 0, seed, 0, sl1);
		System.arraycopy(hs.authPluginPart2, 0, seed, sl1, sl2);
		
		return SecurityUtil.scramble411(passwd, seed);
	}
	
	/**
	 * @see http://dev.mysql.com/doc/internals/en/capability-flags.html#packet-Protocol::CapabilityFlags
     * @see http://dev.mysql.com/doc/internals/en/capability-negotiation.html
	 * @return
	 */
	public static long initClientFlags() {
		int flag = 0;
		flag |= Capabilities.CLIENT_LONG_PASSWORD;
		flag |= Capabilities.CLIENT_FOUND_ROWS;
		flag |= Capabilities.CLIENT_LONG_FLAG;
		flag |= Capabilities.CLIENT_CONNECT_WITH_DB;
		// flag |= Capabilities.CLIENT_NO_SCHEMA;
		boolean usingCompress = false;
//		MycatServer.getInstance().getConfig()
//								.getSystem().getUseCompression() == 1;
		if (usingCompress) {
			flag |= Capabilities.CLIENT_COMPRESS;
		}
		flag |= Capabilities.CLIENT_ODBC;
		flag |= Capabilities.CLIENT_LOCAL_FILES;
		flag |= Capabilities.CLIENT_IGNORE_SPACE;
		flag |= Capabilities.CLIENT_PROTOCOL_41;
		flag |= Capabilities.CLIENT_INTERACTIVE;
		// flag |= Capabilities.CLIENT_SSL;
		flag |= Capabilities.CLIENT_IGNORE_SIGPIPE;
		flag |= Capabilities.CLIENT_TRANSACTIONS;
		// flag |= Capabilities.CLIENT_RESERVED;
		flag |= Capabilities.CLIENT_SECURE_CONNECTION;
		// client extension
		flag |= Capabilities.CLIENT_MULTI_STATEMENTS;
		flag |= Capabilities.CLIENT_MULTI_RESULTS;
		return flag;
	}
}